import React from "react";
import "./contact.css";
function Contact() {
  return (
    <div>
      <div class="inner">
        <h1>PATNA</h1>
        <p>
          <h2>Amity University Patna Campus</h2>

          <p>
            Near Rupaspur Police Station, Rupaspur, Bailey Road, Patna, Bihar -
            801503
          </p>

          <p>Tel: +91-73-600-30061/2/3/4/5/6</p>
          <p>Watsapp No. : 7360030066</p>
          <p>Toll Free No. : 1800-30026090</p>
          <p>Email : admissions@ptn.amity.edu</p>
          <a href="https://www.amity.edu/patna/" target="_blank">
            amity.edu/patna
          </a>
        </p>
      </div>
    </div>
  );
}

export default Contact;
